import React from 'react';
import Header from '../components/Header';
import './ImagesPage.css'; // We'll create this CSS file

const ImagesPage = () => {
  // Sample images data
  const images = [
    {
      id: 1,
      title: "Nature Beauty",
      category: "Nature",
      description: "Beautiful landscape with mountains and lakes",
      image: "/assets/gallery/nature1.jpg"
    },
    {
      id: 2,
      title: "Urban Architecture",
      category: "Architecture",
      description: "Modern city buildings and structures",
      image: "/assets/gallery/urban1.jpg"
    },
    {
      id: 3,
      title: "Wildlife",
      category: "Animals",
      description: "Amazing wildlife photography",
      image: "/assets/gallery/wildlife1.jpg"
    },
    {
      id: 4,
      title: "Abstract Art",
      category: "Abstract",
      description: "Creative abstract compositions",
      image: "/assets/gallery/abstract1.jpg"
    },
    {
      id: 5,
      title: "Portrait",
      category: "Portrait",
      description: "Professional portrait photography",
      image: "/assets/gallery/portrait1.jpg"
    },
    {
      id: 6,
      title: "Travel",
      category: "Travel",
      description: "Beautiful travel destinations",
      image: "/assets/gallery/travel1.jpg"
    }
  ];

  const categories = ["All", "Nature", "Architecture", "Animals", "Abstract", "Portrait", "Travel"];

  return (
    <div>
      <Header />
      
      {/* Images Hero Section */}
      <section className="images-hero">
        <div className="images-container">
          <div className="images-content">
            <h1>Our Gallery</h1>
            <p>Explore our stunning collection of high-quality images and wallpapers for every occasion.</p>
          </div>
        </div>
      </section>

      {/* Gallery Section */}
      <section className="gallery-main">
        <div className="images-container">
          
          {/* Category Filters */}
          <div className="category-filters">
            <h2>Browse by Category</h2>
            <div className="filter-buttons">
              {categories.map(category => (
                <button 
                  key={category} 
                  className="filter-btn"
                >
                  {category}
                </button>
              ))}
            </div>
          </div>

          {/* Image Grid */}
          <div className="gallery-grid">
            {images.map(image => (
              <div key={image.id} className="gallery-item">
                <div className="image-card">
                  <div className="image-wrapper">
                    <img 
                      src={image.image} 
                      alt={image.title}
                      onError={(e) => {
                        e.target.style.display = 'none';
                        e.target.nextSibling.style.display = 'block';
                      }}
                    />
                    <div className="image-placeholder">
                      üñºÔ∏è<br/>
                      <span>{image.title}</span>
                    </div>
                  </div>
                  
                  <div className="image-info">
                    <h3>{image.title}</h3>
                    <span className="image-category">{image.category}</span>
                    <p>{image.description}</p>
                    <div className="image-actions">
                      <button className="download-btn">Download</button>
                      <button className="view-btn">View</button>
                    </div>
                  </div>
                </div>
              </div>
            ))}
          </div>

          {/* Features Section */}
          <div className="features-section">
            <h2>Why Choose Our Images?</h2>
            <div className="features-grid">
              
              <div className="feature-card">
                <div className="feature-icon">üñºÔ∏è</div>
                <h3>High Quality</h3>
                <p>All images are available in high resolution for professional use.</p>
              </div>

              <div className="feature-card">
                <div className="feature-icon">üé®</div>
                <h3>Various Categories</h3>
                <p>Wide range of categories to suit all your needs and preferences.</p>
              </div>

              <div className="feature-card">
                <div className="feature-icon">üì±</div>
                <h3>Multiple Formats</h3>
                <p>Available in different formats and sizes for various platforms.</p>
              </div>

              <div className="feature-card">
                <div className="feature-icon">‚ö°</div>
                <h3>Fast Download</h3>
                <p>Quick and easy download process without any complications.</p>
              </div>

            </div>
          </div>

        </div>
      </section>
    </div>
  );
};

export default ImagesPage;
